    public function import(Request $request)
    {
        //validate the xls file
        $this->validate($request, array(
    'file'      => 'required'
    ));

        if ($request->hasFile('file')) {
            $extension = File::extension($request->file->getClientOriginalName());
            if ($extension == "xlsx" || $extension == "xls" || $extension == "csv") {
                $path = $request->file->getRealPath();
                $data = Excel::load($path, function ($reader) {
                })->get();
                if (!empty($data) && $data->count()) {
                    foreach ($data as $key => $value) {
                        $insert[] = [
                        'code' => $value->code,
                        'description' => $value->description,
                        'qtdesolic' => $value->qtdesolic,
                        'street' => $value->street,
                        'ua' => $value->ua,
                        'lote' => $value->lote,
                        'family' => $value->family,
                        'cubt' => $value->cubt
    
    ];
                    }

                    if (!empty($insert)) {
                        $insertData = DB::table('ocs')->insert($insert);
                        if ($insertData) {
                            Session::flash('success', 'Importado com sucesso!');
                        } else {
                            Session::flash('error', 'Erro ao inserir..');
                            return back();
                        }
                    }
                }

                return back();
            } else {
                Session::flash('error', 'Este arquivo de extenção '.$extension.' não é valido.!! Insira um arquivo xls/csv..!!');
                return back();
            }
        }
    }

