    public function truncate(Request $request)
    {
        $ocs = DB::table('ocs')->delete();
        return back();
    }


    public function create()
    {
        return view('ocs.add');
    }

    public function store(Request $request)
    {  
        try {

            $data = $request->all();

            $ocs = new Ocs();
            
            $ocs->code = $data['code'];
            $ocs->description = $data['description'];
            $ocs->qtdesolic = $data['qtdesolic'];
            $ocs->street = $data['street'];
            $ocs->ua = $data['ua'];
            $ocs->lote = $data['lote'];
            $ocs->family = $data['family'];
            $ocs->cubt = $data['cubt'];
            

            $ocs->r_auth = Auth::user()->id;

            if ($request->image) {
            
                $img = time().'.'.$request->image->getClientOriginalExtension();

                $request->image->move(public_path('images'), $img);

                $ocs->image = $img;

            }

            $ocs->save();

            Session::flash('flash_success', "Item Adicionado com sucesso!");

            Logs::cadastrar(Auth::user()->id, (Auth::user()->name . ' Cadastrou Item: ' . $ocs->code));

        } catch (Exception $e) {
            Session::flash('flash_error', "Erro ao cadastrar item!");
        }

        return Redirect::to('/ocs');
    }

    public function show($code)
    {
        $ocs = Ocs::find($code);

        return view('ocs.show', [
            'ocs' => $ocs, 
        ]);
    }
    
    public function edit($code)
    {
        $ocs = Ocs::find($code);

        return view('ocs.edit', [
            'ocs' => $ocs, 
        ]);
    }

    public function generate($code)
    {
        $ocs = Ocs::find($code);

        $query = DB::select($ocs->query);

        $data = [
            'ocs' => $ocs,
            'query' => $query,
            'columns' => array_keys((array)$query[0]),
        ];

        PDF::setOptions(['dpi' => 150, 'defaultFont' => 'sans-serif']);

        $pdf = PDF::loadView('pdf', $data)->setPaper('a4', 'landscape');

        return $pdf->download( $ocs->code . '.pdf' );
    }

    public function update(Request $request)
    {   
        try {

            $data = $request->all();

            $ocs = Ocs::find($request->get('code'));
            
            $ocs->code = $data['code'];
            $ocs->description = $data['description'];
            $ocs->qtdesolic = $data['qtdesolic'];
            $ocs->street = $data['street'];
            $ocs->ua = $data['ua'];
            $ocs->lote = $data['lote'];
            $ocs->family = $data['family'];
            $ocs->cubt = $data['cubt'];

            if ($ocs->image) {
            
                $img = time().'.'.$ocs->image->getClientOriginalExtension();

                $ocs->image->move(public_path('images'), $img);

                $ocs->image = $img;

            }

            $ocs->save();

            Session::flash('flash_success', "Item atualizado com sucesso!");

            Logs::cadastrar(Auth::user()->id, (Auth::user()->name . ' atualizou um item: ' . $ocs->code));

        } catch (Exception $e) {
            Session::flash('flash_error', "Erro ao atualizar Item!");
        }

        return Redirect::to('/ocs');
    }

    public function destroy($code)
    {   
        try {

            $reports = Ocs::find($code)->delete();

            Session::flash('flash_success', "Item excluído com sucesso!");

            Logs::cadastrar(Auth::user()->id, (Auth::user()->name . ' excluiu o Item ID: ' . $code));

        } catch (\Illuminate\Database\QueryException $e) {

            Session::flash('flash_error', 'Não é possível excluir este item!');

        } catch (Exception $e) {

            Session::flash('flash_error', "Erro ao excluir item!");
        }

        return Redirect::to('/ocs');
    }



